const data = [
  {
    img: v1,
    content:
      "They key is to have every key, the key to open every door. We don’t see them, we will never see them ",
    name: "Office furniture",
  },
  {
    img: v2,
    content:
      "They key is to have every key, the key to open every door. We don’t see them, we will never see them",
    name: "Sale up to 50% OFF",
  },
  {
    img: v3,
    content:
      "They key is to have every key, the key to open every door. We don’t see them, we will never see them",
    name: "Grand Deal",
  },
];

export default data;
